import React from "react";
import { ReactComponent as Logo } from "../logo.svg";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-secondary" >
      <div className="container" data-aos="fade-up">
        <Link className="navbar-brand d-flex align-items-center" to="/">
          <Logo width={40} height={40} className="me-2" />
          <span>Mirarestorasyon</span>
        </Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><Link className="nav-link" to="/">Ana Sayfa</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/about">Hakkımızda</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/services">Hizmetler</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/contact">İletişim</Link></li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
